  const me = useUser();
  if (!me) return null;
  // console.log(me);
  return (
    <CartStyles open>
      <header>
        <Supreme>{me.name}'s Cart</Supreme>
      </header>
      <ul>
        {me.cart.map(cartItem => <CartItem key={cart} />)}
      </ul>
    </CartStyles>
  );
}
